import React from "react";
import Profile from "../Profile";
import "../../App.css"

const Home = () => {
    return (
        // <div>
        //     <h3 className="greeting">Welcome to TOBY</h3>
        // </div>
        <div className="individuals-container">
            {this.state.individuals.map(item => (
                <Profile 
                    id={item.id}
                    name={item.name}
                    title={item.title}
                    img={item.img}
                /> 

            ))}
        </div>
    )
}


export default Home;
